import mongoose from "mongoose";
const userSchema = new mongoose.Schema({
    name : {
        type:String,
        required:true,
    },
    email:{
        type:String,
        required:true,
        unique:true
    },
    password:{
        type:String,
        required:true,
    },
    image:{
        type:String,
        default: "data:image/png;base64,",
    },
    gender:{
        type:String,
        default:"not selected",
    },
    dob:{
        type:String,
        default:"not selected",
    },
    phone:{
        type:String,
        default:"0000000000",
    },
    Address:{
        type:Object,
        default: {
            line1:'',line2:''
        },
    },
    
})

const doctorModel= mongoose.models.user || mongoose.model('user', userSchema)

export default userModel